import {Component, Input, OnInit} from '@angular/core';
import {QuestionsFormService} from '../../services/questions-form.service';

@Component({
  selector: 'app-questions-page',
  templateUrl: './questions-page.component.html',
  styleUrls: ['./questions-page.component.css']
})

export class QuestionsPageComponent implements OnInit {

  quest: [];
  surveyId;
  contactEmail;

  questionsLocal = [
        {
          required: true,
          type: 'CHECKBOX',
          value: 'textQueation_1',
          answers: [
            'text11',
            'text12'
          ]
        },
        {
          required: true,
          type: 'RADIO',
          value: 'textQueation_2',
          answers: [
            'text21',
            'text22'
          ]
        },
        {
          required: true,
          type: 'TEXTAREA',
          value: 'textQueation_3',
          answers: []
        },
        {
          required: true,
          type: 'TEXTBOX',
          value: 'textQueation_4',
          answers: []
        },
        {
          required: true,
          type: 'CHECKBOX_PICTURE',
          value: 'textQueation_5',
          answers: [
            'data:image/jpeg;base64,',
            'data:image/jpeg;base64,',
            'data:image/jpeg;base64,'
          ]
        }
      ];

getQuestions() {
  this.questionsFormService.getSurvey()
    .toPromise()
    .then((data: any) => {
      this.contactEmail = data.contactEmail;
      this.surveyId = data.surveyId;
      this.quest = data.questions;
      this.quest.forEach(item => {
        // @ts-ignore
        item.answers = (item.answers.length > 0) ? JSON.parse(item.answers) : [];
      });
    });
}

  constructor(private questionsFormService: QuestionsFormService) {
  }

  ngOnInit() {
  this.getQuestions();
  }

}
